import { Button, Container } from "@mui/material";
import { Appbar } from "components";
import React from "react";

function Homepage() {
  return (
    <>
      <Appbar />
      <Container disableGutters = "true" >

      <h1> Text </h1>
      <Button> Start App </Button>

      </Container>
    </>
  );
}

export default Homepage;
